import Link from "next/link";
const Card = () => (
  <div className="card" style="width: 18rem;">
        <img className="card-img-top" src={cardImgSrc} alt="Card image cap" />
    <div className="card-body">
            <h5 className="card-title">{cardTitle}</h5>
      <p className="card-text">
                {strBody}
      </p>

      <Link href="/contact">
        <a className="btn btn-outline-primary">{btnCaption}</a>
      </Link>
    </div>
  </div>
);

export default Card;
